import React from "react";
function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div>
      {list.map((item, index) => (
        <div>
          <ul>{item.type === "H1" && <li>{item.name}</li>}</ul>
        </div>
      ))}
    </div>
  );
}
export default StickyBlockBox;
